package com.code.top;



import java.util.HashMap;
import java.util.Iterator;
import java.util.Set;

/***
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 示例 1:
 *
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 * 示例 2:
 *
 * 输入: s = "rat", t = "car"
 * 输出: false
 * 说明:
 * 你可以假设字符串只包含小写字母。
 *
 * 进阶:
 * 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
 *
 * 贡献者
 *
 * 来源：力扣（LeetCode）
 * 链接：https://leetcode-cn.com/problems/valid-anagram
 * 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 *
 * s和t是否都有相同的字母
 */
public class LeetCode_242_748_isAnagram {


    public boolean isAnagram(String s, String t) {

        // 为空
        if( s == null || t ==null || s.length() != t.length() ) return false;

        // 不存在字符
        for (int i = 0; i < s.length(); i++){
            char c = s.charAt(i);
            if(!t.contains(String.valueOf(c))){
                return false;
            }
        }

        HashMap<Character,Integer> map1 = new HashMap<Character,Integer>();
        HashMap<Character,Integer> map2 = new HashMap<Character,Integer>();


        // 存在多个字符，需要个数相同
        for (int i = 0; i < s.length(); i++){
            char c = s.charAt(i);
            char v = t.charAt(i);
            if(!map1.containsKey(c)){
                map1.put(c,1);
            }else{
                Integer count = map1.get(c);
                map1.put(c,count+1);
            }

            if(!map2.containsKey(v)){
                map2.put(v,1);
            }else{
                Integer count = map2.get(v);
                map2.put(v,count+1);
            }
        }

        Iterator<Character> iterator = map1.keySet().iterator();

        while (iterator.hasNext()){
            Character next = iterator.next();
            int m1 = map1.get(next);
            int m2 = map2.get(next);
            if(m1 != m2){
                return false;
            }
        }


        return true;
    }


    /**
     * 大神解法
     * @param s
     * @param t
     * @return
     */
    public boolean isAnagram1(String s, String t) {

        if(s.length() != t.length())
            return false;
        int[] alpha = new int[26];
        for(int i = 0; i< s.length(); i++) {
            alpha[s.charAt(i) - 'a'] ++;
            alpha[t.charAt(i) - 'a'] --;
        }
        for(int i=0;i<26;i++)
            if(alpha[i] != 0)
                return false;
        return true;

    }

    public static void main(String[] args) {
        LeetCode_242_748_isAnagram l = new LeetCode_242_748_isAnagram();
        String a = "";
        String b = "";
        boolean anagram = l.isAnagram(a, b);
        System.out.println(anagram);

    }
}
